<BR><font face="HGP明朝E"><font color="000000"><center><font size="4">ヴィクトリアから第2次世界大戦以前までのアメリカン・カルチャーや<BR>ライフ・スタイルをプロダクト化したブランド。<BR>
オールド・アメリカンの持つ良質な雰囲気を最大限に活かしつつ<BR>現代のライフ・スタイルにあわせアップ・デートしたプロダクトをリリースしています</font></center><BR>-------------------------------------------------------------------------------------------------
<BR><img src=""><BR>

<BR><img src="http://image.rakuten.co.jp/lahaina/cabinet/langlitz/imgrc0069280848.jpg"><BR>




●パラフィン加工のキャンバス地　定番のショルダーバッグ<BR>
●バッグ外側にジッパー付きポケット、<BR>内側にジッパー付きポケットとオープンポケット付<BR>
●バッグ及びポケットのにライニングには<BR>丈夫なシャンタンを使用しています。<BR>
●バッグ側面の携帯電話用ポケットには<BR>ブラス製のブラックアイ・ボタンを使用しています。<BR>
●ショルダーベルトは約60cm～約105cmまで調節可能です。<BR>
●使い始めはパラフィン加工による硬さがありますが、<BR>使い込むごとに柔らかく、<BR>パラフィン加工特有の経年変化をみせます。<BR><BR><BR><style type="text/css">
